import { useNavigate } from "react-router-dom";

const redirect = path => {
    // cambiar la ruta actual
    navigate(`${path}`);
  };

  const reload = path => {
    // refrescar la página
    window.location.reload();
  };

  const objToExport = {
    redirect: redirect,
    reload: reload
  };

  export default objToExport;
